import React from "react";

const ContactUs = () => {
  return (
    <React.Fragment>
      <form>
        <input type="text" name="name" placeholder="Full Name" required />
        <input type="email" name="email" placeholder="Email" required />
        <div className="message-span">
          <input type="text" name="message" className="message" required />
          <span className="message-placeholder">Message</span>
        </div>
        <button type="submit">Send Message</button>
      </form>

      <style jsx>{`
        form {
          margin: 25px 0;
          width: 100%;
          border: 1px solid red;
          height: 280px;
          display: flex;
          flex-direction: column;
          align-items: center;
        }

        input {
          width: 50%;
          height: 30px;
          margin: 15px 0;
        }

        .message-span {
          border: 1px solid red;
          width: 50%;
          height: 200px;
          position: relative;
        }

        .message {
          width: 100%;
          height: 100%;
          margin: 0;
        }

        .message-placeholder {
          position: absolute;
          top: 0;
          left: 0;
        }
      `}</style>
    </React.Fragment>
  );
};

export default ContactUs;
